import React from 'react';

function AboutSection() {
  return (
    <section id="about" className="content-section">
      <h3>О нас</h3>
      <p>Мы предоставляем широкий спектр услуг для поддержки ваших космических миссий, включая разработку технологий, консультации и поддержку проектов.</p>
    </section>
  );
}

export default AboutSection;
